import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';
import shipLogo from './ship.png';  // Import the ship logo image

function App() {
  const [cargoData, setCargoData] = useState([]);  // List of shipments not arrived by ETA
  const [unloadingAreas, setUnloadingAreas] = useState([]);  // List of unloading areas
  const [urgentCargo, setUrgentCargo] = useState(null);  // First cargo to arrive by priority score

  // Fetch cargo data and unloading areas from the backend
  useEffect(() => {
    // Fetch all incoming cargos ordered by ETA
    const fetchCargoData = async () => {
      try {
        const response = await axios.get('/shipments/not-arrived/eta');
        setCargoData(response.data);
      } catch (error) {
        console.error('Error fetching cargo data:', error);
      }
    };

    // Fetch the most urgent cargo by priority score
    const fetchUrgentCargo = async () => {
      try {
        const response = await axios.get('/shipments/not-arrived/priority');
        setUrgentCargo(response.data[0]);  // Get the first cargo in the list
      } catch (error) {
        console.error('Error fetching urgent cargo:', error);
      }
    };

    // Fetch unloading areas
    const fetchUnloadingAreas = async () => {
      try {
        const response = await axios.get('/unloading-areas');
        setUnloadingAreas(response.data);
      } catch (error) {
        console.error('Error fetching unloading areas:', error);
      }
    };

    // Fetch data on mount
    fetchCargoData();
    fetchUrgentCargo();
    fetchUnloadingAreas();

    // Poll the backend every 10 minutes to refresh data
    const interval = setInterval(() => {
      fetchCargoData();
      fetchUrgentCargo();
      fetchUnloadingAreas();
    }, 600000);  // 10 minutes in milliseconds

    // Cleanup interval on component unmount
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="dashboard">
      {/* Left Panel: All Incoming Cargos */}
      <div className="all-cargos">
        <h2>All Incoming Cargos</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>ETA</th>
              <th>Type</th>
              <th>Unloading Time</th>
              <th>Emergency</th>
            </tr>
          </thead>
          <tbody>
            {cargoData.map((cargo) => (
              <tr key={cargo.shipmentId}>
                <td>{cargo.shipmentId}</td>
                <td>{cargo.eta}</td>
                <td>{cargo.cargoType}</td>
                <td>{cargo.estimatedUnloadingTime} mins</td>
                <td>{cargo.urgency === 2 ? 'Yes' : 'No'}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Right Panel */}
      <div className="right-panel">
        {/* Right Top Section: Incoming Cargo */}
        <div className="incoming-cargo">
          <h2>Incoming Cargo</h2>
          {urgentCargo && (
            <div className="cargo-info">
              <img src={shipLogo} alt="Ship Logo" className="ship-logo" />
              <div>
                <p><strong>ID:</strong> {urgentCargo.shipmentId}</p>
                <p><strong>ETA:</strong> {urgentCargo.eta}</p>
              </div>
            </div>
          )}
        </div>

        {/* Right Bottom Section: Unloading Areas */}
        <div className="unloading-areas">
          <h2>Unloading Areas</h2>
          <div className="areas-row">
            {unloadingAreas.map((area) => (
              <div key={area.areaNumber} className={`area ${area.isFilled ? 'busy' : 'free'}`}>
                <p>{area.areaNumber}</p>
                {area.isFilled && area.shipment && (
                  <>
                    <img src={shipLogo} alt="Ship" className="ship-logo" />
                    <p><strong>Cargo ID:</strong> {area.shipment.shipmentId}</p>
                    <p><strong>Start:</strong> {area.startTime}</p>
                    <p><strong>End:</strong> {area.estimatedUnloadingEnd}</p>
                  </>
                )}
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
